import React, { Component,Fragment } from 'react'
import EventListItem from './EventListItem';

class EventList extends Component {
    render() {
        return (
            <Fragment>
                {this.props.event.map(event => (
                    <EventListItem key={event.id} />
                ))}
            </Fragment>
        )
    }
}

export default EventList;
